import axios from "axios"

function Order (){
    axios({
        url:"https://apibyashu.herokuapp.com/api/cakeorders",
        method:"post",
        data:{},
        headers:{
          authtoken:localStorage.token
        }
    }).then((response)=>{
      console.log("order data",response.data)
    },(error)=>{
        console.log(error)
    })
    return(
        <div>
            Order page
        </div>
    )
}
export default Order
